const isAnagram = (s, t) => {
    if (s.length !== t.length){
        return false
    }

    const letters = {}

    for (let i=0;i<s.length;i++){

        if (letters.s[i]){
            letters = {
                [s[i]]: 1
            }
        } else {
            let count = letters[s[i]]
            letters = {
                [s[i]]: count + 1
            }
        }
    }

    console.log(letters)
}
